Ext.data.JsonP['Dashboard_4.4.1_Release_Note']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Dashboard 4.4.1</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n\t\t<div id=\"banner\" class=\"confbox admonition admonition-note aui-message warning shadowed information-macro\">\n\t\t\t<p>You can now find Appcelerator documentation at <a href=\"https://docs.axway.com/\" target=\"_blank\">https://docs.axway.com/</a>. This site will be taken down in the near future.</p></div>\n        <div class=\"header\"/>\n\n        <div id=\"src-46240329\" class=\"content\">\n                        <h1>Dashboard 4.4.1</h1>\n    <p>Dashboard 4.4.1 is a patch release, which includes an improvement and a few bug fixes.    </p>\n    <div class=\"section section-2 \" id=\"src-46240329_Dashboard4.4.1ReleaseNote-NewFeatures\">\n        <h2 class=\"heading \"><span>New Features</span></h2>\n    <p>    <img src=\"images/download/attachments/46240329/Delete.gif\" alt=\"images/download/attachments/46240329/Delete.gif\" class=\"confluence-embedded-image image-right\" width=\"500\">\n        </img></p>\n<ul class=\" \"><li class=\" \">    <p>You can now delete Arrow Cloud applications and ArrowDB datasources from the All Projects view.    </p>\n</li></ul>    </div>\n    <div class=\"section section-2 \" id=\"src-46240329_Dashboard4.4.1ReleaseNote-FixedIssues\">\n        <h2 class=\"heading \"><span>Fixed Issues</span></h2>\n<ul class=\" \"><li class=\" \">    <p>Fixed issue where the map was not appearing on the Dashboard main page.    </p>\n</li><li class=\" \">    <p class=\"p1\">Fixed issue with Arrow app access logs was missing HTTP method, URL, and remote address.    </p>\n</li></ul>    <p>    </p>\n    <p>    </p>\n    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=46240329\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"Dashboard 4.4.1 Release Note"});